    const tabBarHeight = useBottomTabBarHeight();

    return (
        <SafeAreaView style={[styles.container]}>
            <ScrollView>
                <Event title="Title text" location="Hell" time="Always"/>
                <Event title="Title text" location="Hell" time="Always"/>
                <Event title="Title text" location="Hell" time="Always"/>
                <Event title="Title text" location="Hell" time="Always"/>
            </ScrollView>
        </SafeAreaView>

    )
}   

export default Home

const styles = StyleSheet.create({
    container: {
        flex: 1,
        backgroundColor: "#e28f66"
    }
})
